package java0308;

import java.util.Scanner;

public class height {

	private static Scanner in;

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int foot;
		double inch;
		in = new Scanner(System.in);
		foot = in.nextInt();
		inch = in.nextDouble();
		System.out.println(foot);
		System.out.println(inch);
	}

}
